import React from "react";

import "./App.css";

function App() {
  return (
    <div className="App">
      <header>
        <div>Logo</div>
        <nav class="nav justify-content-center">
          <a class="nav-link active" href="#">
            Active link
          </a>
          <a class="nav-link" href="#">
            Link
          </a>
          <a class="nav-link disabled" href="#">
            Disabled link
          </a>
        </nav>
      </header>
    </div>
  );
}

export default App;
